function digitValidator(a){let e=a.slice(0,4).toUpperCase();var r=serialValidator(a.slice(4,a.length-1).split(""))+nameValidator(e.split("")),c=r-11*parseInt(r/11);return 10===c?0:c}function nameValidator(a){var e=[];return a.forEach(function(a,r){e.push(getAlphanumericObject(a)*Math.pow(2,r))}),e.reduce(function(a,e){return a+e})}function serialValidator(a){var e=[],r=[4,5,6,7,8,9];return a.forEach(function(a,c){e.push(a*Math.pow(2,r[c]))}),e.reduce(function(a,e){return a+e})}function getAlphanumericObject(a){var e;switch(a){case"A":e=10;break;case"B":e=12;break;case"C":e=13;break;case"D":e=14;break;case"E":e=15;break;case"F":e=16;break;case"G":e=17;break;case"H":e=18;break;case"I":e=19;break;case"J":e=20;break;case"K":e=21;break;case"L":e=23;break;case"M":e=24;break;case"N":e=25;break;case"O":e=26;break;case"P":e=27;break;case"Q":e=28;break;case"R":e=29;break;case"S":e=30;break;case"T":e=31;break;case"U":e=32;break;case"V":e=34;break;case"W":e=35;break;case"X":e=36;break;case"Y":e=37;break;case"Z":e=38}return e}

function validationCode(container) {
	container.keyup(function(){
	var verificateCode = null;
	var digito=null
	if($(this).val().length==10){
		for(var i=0; i < $(this).val().length; i++){
			var value=$(this).val().charAt(i).toUpperCase();
			if(value.match(/^[A-Z]+$/)){
				if(value=="A"){
					value =10;
				}
				if(value=="B"){
					value =12;
				}
				if(value=="C"){
					value =13;
				}
				if(value=="D"){
					value =14;
				}
				if(value=="E"){
					value =15;
				}
				if(value=="F"){
					value =16;
				}
				if(value=="G"){
					value =17;
				}
				if(value=="H"){
					value =18;
				}
				if(value=="I"){
					value =19;
				}
				if(value=="J"){
					value =20;
				}
				if(value=="K"){
					value =21;
				}
				if(value=="L"){
					value =23;
				}
				if(value=="M"){
					value =24;
				}
				if(value=="N"){
					value =25;
				}
				if(value=="O"){
					value =26;
				}
				if(value=="P"){
					value =27;
				}
				if(value=="Q"){
					value =28;
				}
				if(value=="R"){
					value =29;
				}
				if(value=="S"){
					value =30;
				}
				if(value=="T"){
					value =31;
				}
				if(value=="U"){
					value =32;
				}
				if(value=="V"){
					value =34;
				}
				if(value=="W"){
					value =35;
				}
				if(value=="X"){
					value =36;
				}
				if(value=="Y"){
					value =37;
				}
				if(value=="Z"){
					value =38;
				}
			}
			
			verificateCode=verificateCode+(value*(Math.pow(2, i)))
		}
		digito=verificateCode
		verificateCode= Math.trunc(verificateCode/11) 
		verificateCode= Math.trunc(verificateCode*11)  
		digito=digito-verificateCode
		if(digito==10){
		digito=0
		}
		$(this).val($(this).val()+digito)
	}
})
}
